import React from "react";
import {
  CommentDiv,
  DetailComment,
  DetailContainer,
  DetailBanner,
  ImageBox,
  ImageText,
  ImgDiv,
  DetailTitle,
} from "./style";

const ContainerForm = () => {
  return (
    <>
      <DetailContainer>
        <DetailBanner>Oh! Honey Scrooge</DetailBanner>
        <DetailTitle>상세 페이지</DetailTitle>
        <ImgDiv>
          <ImageBox>
            <p>꿀템 사진</p>
          </ImageBox>
          <ImageText>
            <p>꿀템 설명</p>
          </ImageText>
        </ImgDiv>
        <CommentDiv>
          <DetailComment input type="text" placeholder="댓글을 입력하세요">
            {" ㅁㅇㄴㄹㅁㄹㄴㅇ"}
            댓글 입력창
          </DetailComment>
          <button>확인</button>
          <button>수정</button>
          <button>삭제</button>
        </CommentDiv>
      </DetailContainer>
    </>
  );
};

export default ContainerForm;
